// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage'; // Correct if using default export
import PropertyList from './pages/PropertyList'; // Correct if using default export
import ServicePage from './pages/ServicePage'; // Correct if using default export
import Header from './components/Header'; // Correct if using default export
import Footer from './components/Footer'; // Correct if using default export

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/properties" element={<PropertyList />} />
        <Route path="/services" element={<ServicePage />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
